    return (
        <div className="Menu">
            <div className="title">Our Menu</div>
            <div className="filterMenu">
                <div>Breakfast</div>
                <div>Lunch</div>
            </div>
            <div className="container">
                <div className="items">
                    {
                        menuList.map((item)=>(
                            category === item.category 
                            ? (
                                <div>{item.category}</div>
                            )
                            :""
                        ))
                    }
                </div>
            </div>
        </div>
    )
}

export default Menu
